import React from "react";
/* import Topbar from "../../components/Topbar/Topbar"; */
import "./home.scss";

const Home = () => {
  return (
    <>
      <div className="home">
        <div className="container">
          <div className="home__titulo">
            <h2>Dashboard Cafeso</h2>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
